import React from "react";
import "./style.css"; // Import your CSS file

function MonthSpendCarousel() {
  const data = [
    {
      category: "식품",
      cost: 50000,
      analytics: "테스트1",
    },
    {
      category: "여행",
      cost: 1000000,
      analytics: "테스트2",
    },
    {
      category: "문화",
      cost: 247000,
      analytics: "테스트3",
    },
  ];

  return (
    <div className="slider">
      <div className="slide-track">
        {data.map((item, idx) => (
          <div key={idx} className="slide">
            {item.category}
          </div>
        ))}
      </div>
    </div>
  );
}

export default MonthSpendCarousel;
